/*Table structure for table `allorder` */

DROP TABLE IF EXISTS `allorder`;

CREATE TABLE `allorder` (
  `ORDE_ID` varchar(11) DEFAULT NULL COMMENT '订单号',
  `ORDE_CUSTOMERID` varchar(11) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '顾客id',
  `ORDE_PRODUCT` varchar(256) DEFAULT NULL COMMENT '订单内容',
  `ORDE_PRICE` int(9) DEFAULT NULL COMMENT '订单金额',
  `ORDE_STARTTIME` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `ORDE_CUSTOMERNAME` varchar(15) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '顾客姓名',
  `ORDE_PAYWAY` int(3) DEFAULT NULL COMMENT '支付方式',
  `ORDE_STATE` int(3) DEFAULT NULL COMMENT '状态',
  `ORDE_EVALUATION` varchar(1024) DEFAULT NULL COMMENT '评价',
  `ORDE_EVALUATIONSTATUS` int(3) DEFAULT NULL COMMENT '评价状态',
  `ORDE_NUM` int(9) DEFAULT NULL COMMENT '销量',
  `ORDE_PROVIDERNAME` varchar(60) DEFAULT NULL COMMENT '服务商名称'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

